targets.queryText:
PRAGMA read_uncommitted = 1;
SELECT 
 CPUStatAll 
FROM 
 tkmSysProcStat NOLOCK 
WHERE CPUStatName = 'cpu' AND ReceiveTime > ${__from:date:seconds} ORDER BY ReceiveTime DESC LIMIT 1;

